import React from 'react';
import Box from '@mui/material/Box';
import { Button, FormControl, InputLabel, MenuItem, Select, Typography } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { shopsPageMockData } from './mockData';

export default function ShopsPage() {
  const navigation = useNavigate();

  const handleAddShopsClick = () => {
    navigation('/AddShops');
  };

  const handleAddInventoriesClick = () => {
    navigation('/AddInventories');
  };

  const handleAddProductsClick = () => {
    navigation('/AddProducts');
  };

  const generateMenuItems =()=>{
    return shopsPageMockData.shopsList.map((shop)=>(
      <MenuItem>
        <span>{shop.options[0].label}</span>
      </MenuItem>
    ))
  }

  return (
    <Box
      sx={{
        minHeight: '100vh',
        padding: '3%',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <Box
        sx={{
          display: 'flex',
          flexDirection: 'column',
          gap: '10px',
          marginBottom: '30px',
        }}
      >
        <Button onClick={handleAddShopsClick} variant="contained">
          ADD SHOPS
        </Button>
        <Button onClick={handleAddInventoriesClick} variant="contained">
          ADD INVENTORIES
        </Button>
        <Button onClick={handleAddProductsClick} variant="contained">
          ADD PRODUCTS
        </Button>
      </Box>

      <Box
        sx={{
          display: 'flex',
          gap: '10px',
        }}
      >
        <FormControl fullWidth>
          <InputLabel id="searchShop">SEARCH SHOP</InputLabel>
          <Select
            id="searchShop"
            label="Search for shop"
            fullWidth
            value="Search for shop"
            sx={{ marginRight: '10px' }}
          >
            {generateMenuItems()}
          </Select>
        </FormControl>

        <Button style={{ padding: '10px 20px', borderRadius: '7px' }}>SUBMIT</Button>
      </Box>

      <Typography id="loader" sx={{ display: 'none' }}>
        Loading...
      </Typography>
    </Box>
  );
}
